import React from 'react'
import './Card.css'

const Card = (props) => {
    return (
        <div className="card">
            <img src={props.url} alt="Avatar" style={{ width: "100%" }}></img>
            <div className="container">
                <h4><b>John Doe</b></h4>
                <p>Architect & Engineer</p>
            </div>
        </div>
    )
}

export default Card;
